declare namespace Socket {
    type TMessageObject<MsgId extends number, Data> = {
        msgId: MsgId;
        msgData: Data;

        ctor?: new (...args: any[]) => IMessageClass;
    };

    type TMessageData<MsgId extends number, Data> = Uint8Array | TMessageObject<MsgId, Data>;

    type IMessageCallback<MsgId extends number, Data> = (data: TMessageObject<MsgId, Data>) => void;

    interface IMessageClass extends import("google-protobuf").Message {
        toObject(): any;
        serialize(): Uint8Array;
    }

    interface IMessageCtor {
        name?: string;

        deserialize(bytes: Uint8Array): IMessageClass;
        fromObject(data: any): IMessageClass;
    }

    interface SocketOption {
        gameId: number;
    }

    interface SocketInitOptions<MsgId extends number, Data> extends Partial<SocketOption> {
        host?: string | string[];

        onMessage?: IMessageCallback<MsgId, Data>;
        onOpen?: () => void;
        onClose?: () => void;
    }

    interface IScoketProto {
        getMessageCtor(msgType: number): any;
    }

    interface ISocketAttachmentConstructorParameters {
        gameId: number;
        listener: cc.EventTarget;
    }

    interface ISocketAttachmentConstructor {
        new (options: ISocketAttachmentConstructorParameters): ISocketAttachment;
    }

    interface ISocketAttachment extends IScoketProto {
        tag: string;

        applyConfig(config: ISocketConfig);

        onInit(option: SocketOption): void;

        onOpen(): void;

        onClose(): void;

        onMessageHandle(data: TMessageObject<number, any>): void;

        onSendMessage(msgType: number, data: IMessageClass);

        onBeforeUserClose(): void;
    }

    interface ISocketConfigs {
        log?: ISocketLogConfig;
    }

    interface ISocketConfig {
        blacklist?: number[];
    }

    interface ISocketLogConfig extends ISocketConfig {
        [index: string]: any;
    }
}
